                <div class="absolute inset-0 flex flex-col justify-center items-center text-center text-white">
                    <h1 class="text-4xl md:text-6xl font-bold mb-4">Callaway Golf Scoring App</h1>
                    <p class="text-lg md:text-xl mb-8">Welcome to the ultimate companion for tracking scores and managing your golf rounds.</p>
                    <div class="space-y-4">
                        {/* <a href="#" class="bg-blue-500 hover:bg-blue-600 text-white py-3 px-6 rounded-lg shadow-md transition duration-300 ease-in-out inline-block">Enter a Round</a> */}
                        {/* <a href="#" class="bg-gray-500 hover:bg-gray-600 text-white py-3 px-6 rounded-lg shadow-md transition duration-300 ease-in-out inline-block">Check out Leaderboard</a> */}
                    </div>
                </div>
            </div>
        </div>

    );

};

export default Home;
